import { Link } from 'react-router-dom';
import { Container, Row, Col } from 'react-bootstrap';
import CatImage from './cat.jpg'; // Import your cat image
import DogImage from './dog.jpg'; // Import your dog image
import BirdImage from './bird.jpg'; // Import your bird image

const HomePage = () => {
  const imageStyle = {
    width: '100%',
    height: '300px',
    objectFit: 'cover',
    borderRadius: '10px',
  };

  const cardStyle = {
    border: '2px solid #ccc',
    borderRadius: '10px',
    marginBottom: '20px',
    padding: '10px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    transition: 'transform 0.3s ease',
  };

  const textStyle = {
    textAlign: 'center',
    fontSize: '1.5rem',
    fontWeight: 'bold',
    color: '#333',
    marginTop: '10px',
  };

  return (
    <Container style={{ paddingTop: '30px', paddingBottom: '30px' }}>
      <h1 style={{ textAlign: 'center', marginBottom: '30px' }}>Welcome to Our Pet Gallery</h1>
      <Row>
        <Col md={4}>
          <Link to="/cats" style={{ textDecoration: 'none', color: '#333' }}>
            <div style={cardStyle}>
              <img src={CatImage} alt="Cats" style={imageStyle} />
              <div style={textStyle}>View Cats Gallery</div>
            </div>
          </Link>
        </Col>
        <Col md={4}>
          <Link to="/dogs" style={{ textDecoration: 'none', color: '#333' }}>
            <div style={cardStyle}>
              <img src={DogImage} alt="Dogs" style={imageStyle} />
              <div style={textStyle}>View Dogs Gallery</div>
            </div>
          </Link>
        </Col>
        <Col md={4}>
          <Link to="/birds" style={{ textDecoration: 'none', color: '#333' }}>
            <div style={cardStyle}>
              <img src={BirdImage} alt="Birds" style={imageStyle} />
              <div style={textStyle}>View Birds Gallery</div>
            </div>
          </Link>
        </Col>
      </Row>
    </Container>
  );
};

export default HomePage;
